import React from "react";

const CollectionPreview = ({ title, items }) => {
  return (
    <div>
      {items.map(object => {
        return (
          <div key={object.id}>
            <h1>{title}</h1>
            {object.name}
          </div>
        );
      })}
    </div>
  );
};

export default CollectionPreview;
